import React from 'react';
import { Card } from 'react-bootstrap';

interface StatisticsProps {
    symbol?: string;
    name?: string;
    price?: string;
    dollar_difference?: string;
    percent_difference?: string;
}

const StatisticsWidget = ({ symbol, name, price, dollar_difference, percent_difference }: StatisticsProps) => {
    return (
        <Card style={{ width: '18rem' }}>
            <Card.Body className="card-body">
                <div className="d-flex align-items-start">
                    <div className="flex-1 text-end align-self-center">
                        <h3 className="mt-0">
                            <span>
                                {symbol}
                            </span>
                        </h3>
                        <p className="text-muted mb-0">{dollar_difference}</p>
                        <p className="text-muted mb-2">{percent_difference}</p>
                    </div>
                </div>
            </Card.Body>
        </Card>
    );
};

export default StatisticsWidget;
